import './ExpensesElements.css'
const ExpensesElements = () => {
	return (
		<div className='expenses-elements'>
			<div className='expenses-elements__date'>
				<div>2019</div>
			</div>
			<h1>Title</h1>
			<div className='expeneses-elements__price'>400$</div>
		</div>
	)
}

export default ExpensesElements
